import styles from "./Register.module.css";
import { Link, Navigate } from "react-router-dom";
import { useState, useEffect } from "react";
import Navbar from "../../components/Navbar/Navbar";
import logoAdd from "../../assets/icons/person_add_black_24dp (1).svg";

const Register = () => {
  return (
    <div className={styles.container}>
      <Navbar />
      <div className={styles.infoRectangle}>
        <h1 className={styles.titleAdd}>
          <img src={logoAdd} alt="logoAdd" /> CADASTRAR UM NOVO USUÁRIO
        </h1>
        <div className={styles.containerInput}>
          <label>
            USUÁRIO <input type="text" />
          </label>
          <label>
            NOME <input type="text" />
          </label>
          <label>
            EMPRESA <input type="text" />
          </label>
          <label>
            CNPJ <input type="text" />
          </label>
        </div>
      </div>
    </div>
  );
};

export default Register;
